INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','Warunki dostawy','Warunki dostawy','pack, dostawa, paczka, opóźnienie, kurier, zwrot','<h2>Dostawa</h2>\n<div class=\"row lead-p\" style=\"padding:0px;margin:0px -16px 40px;color:#4d4d4d;font-family:Lato, sans-serif;font-size:14px;font-weight:400;background-color:#ffffff;\">\n<div class=\"col-xs-12\" style=\"padding:0px 16px;margin:0px;min-height:1px;float:left;width:1189.97px;\">\n<p style=\"padding:0px;margin:0px 0px 10px;font-size:16px;color:#666666;\">Zamówiony przez Ciebie towar wysyłamy za pośrednictwem firmy kurierskiej UPS, kuriera InPost lub Listem Poleconym InPost. <br />Przesyłki dostarczamy również do Paczkomatów InPost. Wysyłki realizujemy jedynie na terenie Polski. Nasze pozdespoły wysyłamy <br />w ciągu 3 dni roboczych.</p>\n</div>\n</div>','dostawa'),(2,1,1,'Regulamin','Regulamin','Regulamin sklepu','regulamin, prawo, zasady','<h2>Regulamin:</h2>\n<p>Sklep istnieje na potrzeby projektu na studia Informatyka na Politechnice Gdańskiej, nie jest możliwy żaden realny zakup.</p>\n<p>Stworzono przy pomocy <a href=\"http://www.prestashop.com\">PrestaShop</a>™.</p>','regulamin'),(3,1,1,'Polityka prywatności','Polityka prywatności','Nasza polityka prywatności','conditions, terms, use, sell','<h2 style=\"text-align:left;\">Polityka Prywatnosci</h2>\n<h3 style=\"padding:0px;margin:20px 0px 10px;font-size:16px;line-height:24px;color:#4d4d4d;font-weight:normal;font-family:Lato, sans-serif;background-color:#ffffff;text-align:left;\">Dbamy o Twoją prywatność</h3>\n<p class=\"lead\" style=\"padding:0px 0px 20px;margin:0px 0px 20px;font-size:16px;color:#666666;line-height:1.5;font-family:Lato, sans-serif;background-color:#ffffff;text-align:left;\">Od 25 maja 2018 roku w całej Unii Europejskiej obowiązuje nowe Rozporządzenie o Ochronie Danych Osobowych (RODO). W związku z tym przetwarzamy wszystkie dane zgodnie z tym rozporządzeniem</p>','polityka-prywatnosci'),(4,1,1,'O nas','O nas','Kim jesteśmy','about us, informations','<h2>O nas</h2>\n<p>Jestesmy studentami studiów zaocznych na Politechnice Gdańskiej. Nasz zespół to:</p>\n<p>Marcin Grzybek 165669</p>\n<p>Bartosz Głodkowski 172904</p>\n<p>Michał Łaszyn 165229</p>\n<p></p>','o-nas'),(5,1,1,'Metody płatności','Metody płatności','Nasze metody płatnośći','mastercard, paypal, visa, blik, eprzelewy','<h3>Dostępne metody płatności:</h3>\n<p><strong>Visa/Mastercard/Paypal/Blik/ePrzelewy</strong></p>','metody-platnosci');
