esz dostroić ustawienia \nwydajności, aby idealnie pasowały do Twojego stylu pracy, co pozwoli Ci \nzmaksymalizować produktywność.\nPrecyzyjne cyfrowe sterowanie zasilaniem<br />\nModuł\nregulatora napięcia Digi+ (VRM) w czasie rzeczywistym kontroluje spadki\nnapięcia, automatycznie przełączając ustawienia częstotliwości \ntaktowania oraz wydajności energetycznej.\nZnakomite chłodzenie<br />\nPłyty\ngłówne z serii Prime Z690 są wyposażone w kilka zintegrowanych \nradiatorów oraz zestaw hybrydowych gniazd na wentylatory dla \nzapewniania, że Twój system zachowa chłodną temperaturę i stabilność pod\nwysokim obciążeniem.\nRadiator M.2<br />\nRadiator \nM.2 chłodzi gniazda M.2, zapobiegając efektowi \"throttlingu\", który może\nwystąpić w przypadku dłuższych transferów danych z dysków M.2.\nRadiatory VRM i wysokiej jakości podkładki termiczne<br />\nMasywne\nradiatory VRM i wysokiej jakości podkładka termiczna zwiększają \nskuteczność transferu ciepła od tranzystorów MOSFET i dławików dla \nlepszej wydajności chłodzenia.\nKilka źródeł monitorowania temperatury<br />\nKażde gniazdo może dynamicznie reagować na trzy czujniki termiczne.\nInteligentna ochrona<br />\nWbudowany dedykowany obwód elektryczny chroni wszystkie gniazda na wentylatory przed przegrzaniem oraz przepięciami.\n4-pinowy wentylator PWM / DC<br />\nKażde zintegrowane gniazdo obsługuje funkcję automatycznego wykrywania wentylatorów PWM lub DC.\nŚwietna wydajność<br />\nPłyty\ngłówne z serii Prime Z690 są zaprojektowane pod kątem obsługi wielu \nrdzeni i zwiększonej przepustowości procesorów. Płyty główne ASUS Z690 \noferują wszystkie najważniejsze funkcje do przyspieszenia codziennej \npracy produktywnej, dzięki czemu Twój system będzie gotowy do akcji i \nzapewni Ci stabilną moc, intuicyjne sterowanie chłodzeniem oraz \nelastyczne opcje transferów danych.\n14+1 DrMOS<br />\nUkład VRM z 14+1 fazami DrMOS dostarcza moc i wydajność potrzebne do zaspokojenia potrzeb zaawansowanych procesorów.\nKarta sieciowa 